import React, {Component}from 'react';
import Avatar from 'material-ui/Avatar';

class IntroPage extends Component {
  render(){
    return (
      <div class = "Introduction">
        <Avatar src="avatar.jpg" size={150}/>
      </div>
    );
  }
}

export default IntroPage;
